R["oh__@onyxorb"]="{['TS']=1726706797,['eu']={[42]={['C']=1.037000,['D']='Forgotten Shrine.\\n\\nI did a destroyed shrine build on PC/NA.  This represents that that shrine \\'Before the Fall\\'.',['O']=19753,['N']='Before the Fall',},},['Key']='oh__@onyxorb',['Version']=1773,['na']={[1]={['C']=1.023000,['D']='Quick Build using items mailed to me by Kalities,  the candle already here, and a looted axe that was in my inventory.\\n\\nThe father has made his will known on what build needed to be done.\\n\\nHail Sithis!',['O']=19787,['N']='Kalities\\' Gift',},[64]={['C']=1.012000,['D']='Breached Ruins?  Why and How?\\nFind the open secrets.\\n(This is a re-list for descriptive purposes)',['O']=19020,['N']='Breached Sanctuary',},[70]={['O']=19955,['N']='Temple Ruin & Museum',},[73]={['C']=1.014000,['D']='Explore the Grounds as the Staff get the Lucky Cat Resort ready for another Day of Fun and Activities.\\nThe Lava Dancing Pit, Bar & Aquarium, and Reading Nooks will soon be ready to Welcome Visitors.   Feel Free to Check in for Longer stays.',['O']=19385,['N']='Lucky Cat Resort',},[74]={['C']=1.020000,['D']='Mage Library and Campus\\n\\nMain Library of the Mage College.  Also includes part of the Campus with Facilities and Housing.\\n\\nAlso possible to explore the ruins that the Campus is built over.',['O']=19135,['N']='Mage Campus',},[75]={['C']=1.041000,['D']='Medieval Port Town.  Gated for Security.',['O']=19078,['N']='Port Lady of Light',},[76]={['O']=18707,['N']='The Oasis',},[13]={['C']=1.026000,['D']='Lamae\\'s Lament...\\n\\nI\\'ve always loved the Vampire Initiation quest.  It\\'s one of the most powerful stories in the game.\\n\\nI\\'m also a fan of the Vampiric portion of the Coldharbor quest line.\\n\\nI\\'ve combined those two stories into one build.\\n\\nI hope this shrine is still close enough to lore.',['O']=19409,['N']='Lamae\\'s Lament',},[14]={['C']=1.031000,['D']='Forest Retreat.\\nHome of my Fantasy Wood Elf.\\nMeant as a home to just sit and enjoy the view and sounds.',['O']=19369,['N']='Forest Hideaway',},[15]={['C']=1.021000,['D']='Relaxing Cottage built from a Greenhouse.\\nIncludes private garden and fishing spot.',['O']=19047,['N']='Greenhouse Cottage',},[16]={['O']=18506,['N']='Secret Garden',},[81]={['O']=18743,['N']='Alpine Campgrounds',},[18]={['C']=1.026000,['D']='The Noble Knight Pub and Inn\\n\\n\\r\\nWelcome to your home away from home.  \\r\\nCome in for a drink and a hot meal.\\r\\nStay for the friendship and the entertainment.\\r\\n\\r\\nWe also provide the finest lodgings including bedding with feather mattresses.\\r\\nAmenities include Stable, in room Wash Ups, Privacy Screens, Incense, and more.\\r\\n\\r\\nNOTES: \\r\\nA True Knight helps all that are in need.  Even if that helps must be provided in the shadows. \\r\\nThis is my attempt at making a more lore accurate build than my usual st',['O']=19783,['N']='The Noble Knight',},[19]={['O']=18506,['N']='Elsweyr Embassy',},[21]={['O']=18829,['N']='Hell\\'s Prison',},[86]={['C']=1.037000,['D']='\\rThe Hall of Souls is where the souls of my  characters reside when not on Tamriel.\\r\\n\\r\\nThe areas around each soul\\'s storage crystal changes over time to reflect that soul\\'s purpose.\\r\\n\\r\\nThe Entry Hall houses the newer souls that are not fully defined yet.\\r\\n\\nEstablished souls are in the center near the Tree of Life that powers the Hall.\\n\\r\\nThe Hall of Ancestors houses the oldest and most defined souls.\\r\\n\\r\\nThe Temple of Portals is where the souls select which realm to enter.\\r\\n\\r\\n',['O']=19963,['N']='Hall Of Souls',},[23]={['C']=1.026000,['D']='Den of Thieves with Fencing storefront.',['O']=18846,['N']='Thieve\\'s Den',},[25]={['O']=18749,['N']='Retired Gardener',},[28]={['O']=18506,['N']='Wayfarer Inn',},[31]={['O']=18507,['N']='Underwater Grotto',},[32]={['C']=1.026000,['D']='Crafting Villa for my Orc Crafter.  Designed after her favorite Crafting spot in Vivec City.\\n',['O']=18980,['N']='Crafting Villa',},[99]={['C']=1.015000,['D']='The Fair Winds flagship with it\\'s escort ships.\\n\\nCaptain\\'s Quarters includes a relaxation area where the Captain routinely treats the Officers and Outstanding Crew members.',['O']=19585,['N']='Fair Winds Fleet',},[100]={['C']=1.500000,['D']='Welcome to Loft Living!\\n\\nThis Loft unit offers all the amenities needed for those living in the Hustle and Bustle of Necrom City Life.',['O']=19815,['N']='Loft Living - Rental',},[37]={['C']=1.041000,['D']='Serenity Village\\n\\nWatch the Villagers of this Tiny Town as they go about their daily routines.\\n\\nVisit the shops or Browse the \"Castle Ruins Adventurer\\'s\" to see their latest Treasures.\\n\\nIf you\\'re lucky you can be a part of the local gossip circle in front of the Tailor\\'s shop.  Don\\'t be Late though, the Early Bird gets the Worm AND the Gossip.\\n\\nEnjoy your visit!\\n\\n* The cool mini home designs are from a guildie Caede who said it could use them 8^).',['O']=19629,['N']='Serenity Village',},[39]={['C']=1.021000,['D']='This is the Estate of my Main Adventuring toon.  She is a proud vampire and member of the Thieve\\'s guild and Dark Brotherhood.  It is geared around her personal taste and favorite zones/quest lines.\\n',['O']=19288,['N']='Crimson Chateau',},[104]={['C']=1.017000,['D']='Celestrial Citadel (aka Crystal Castle)\\n\\nPersonal Retreat of OnyxOrb the Storm Mage.\\nWhile she specializes in Storm/Lightning magic, her areas of research include all things Celestrial.\\n\\nCastle include Grand Dining room which doubles as a meeting space for visiting Mages.\\n\\nHer Personal area reflects her expensive taste, but she\\'s been around long enough to deserve it.\\n\\nHer Private Library and Personal Lab are guarded, so visit at your own risk.',['O']=19650,['N']='Celestial Citadel',},[42]={['C']=1.037000,['D']='Temple Ruins.\\n\\nMore fun for the visitors to determine what has happened here.',['O']=19770,['N']='After The Fall',},[107]={['C']=1.021000,['D']='Willow Pond Estate\\r\\n\\r\\nWillow Pond Terrace consists of 2 private estates.\\r\\nWillow Pond Row consists of 3 vacation rental homes.\\r\\n \\r\\nRental units feature kitchen, living, and master loft areas as well as indoor plumbing and balconies.\\r\\nCypress Cave and Ivy Island are restricted to Willow Pond tenants, and guests of Willow Pond Terrace.\\r\\n\\r\\nEnjoy your stay\\r\\n',['O']=19854,['N']='Willowpond Estates',},[111]={['C']=1.021000,['D']='Vacation Villa that is made available to my toons to visit.\\n\\nThere is an onsite Caretaker that maintains the property year round, so that it is always in pristine shape when guests arrive.\\n\\nProperty includes private dock and gardens.',['O']=19985,['N']='Vacation Villa',},[49]={['O']=18506,['N']='Pandora\\'s Hut',},[58]={['O']=18507,['N']='Hidden Camp',},[59]={['C']=1.021000,['D']='Home of my Healer/Alchemist.  She uses alchemy to hide a certain \\'condition\\'.  Even the guests to her Estate are unaware of her true nature, or her hidden Lair.\\n\\n<spoiler> First Person mode may be needed to properly enter the lair.',['O']=18973,['N']='The Alchemist\\'s Lair',},[22]={['C']=1.025000,['D']='Personal Library and Study for Relaxing',['O']=19424,['N']='Home Library/Study',},[63]={['O']=18549,['N']='Santa\\'s Workshop',},},}"
