R["oh__@rivathyn"]="{['na']={[1]={['C']=1.500000,['D']='a hideaway for my old argonian healer Hoards-The-Gems who is now a necromancer',['N']='Vulkhel Guard Inn',['O']=19060,},[34]={['C']=1.500000,['D']='',['N']='Hallin\\'s Stand House',['O']=18920,},[3]={['C']=1.500000,['D']='This was the very first house i decorated back when housing came out. it recently gained an update where i put people in its bed. they\\'re having a sleepover :)',['N']='The Flask',['O']=18874,},[68]={['C']=1.500000,['D']='',['N']='Rimmen Inn',['O']=19060,},[5]={['C']=1.500000,['D']='',['N']='Sentinel Apartment',['O']=18920,},[6]={['C']=1.500000,['D']='',['N']='Mournhold Apartment',['O']=19060,},[11]={['C']=1.029000,['D']='Lovingly reskinned to look like the Blood Tundra from the now shut down game Fer.al, marked as memorial for that reason alone.\\n\\nGained proper snow on Nov 25 2022 after too long with just coral as a stand-in\\nShould have 5 fx',['N']='Blood Tundra House',['O']=19322,},[77]={['C']=1.500000,['D']='Tired of walking all the way to the bathroom after a long night of drinking? \\nCan\\'t be bothered with chamber pots?\\nWell then you\\'re in luck! \\nLook no further than my patented Litterbox, perfect for all your bathroom needs!!\\n\\n[ disclaimer: the litter is non-clumping. ]\\n\\nDedicated to @mahvirnadas for sending me the sAnD that made this possible',['N']='The Litterbox',['O']=19096,},[16]={['C']=1.500000,['D']='( fun description to be added later )',['N']='Daggerfall House',['O']=19060,},[81]={['C']=1.031000,['D']='Reskinned around the entrance to look like the inside of a tree , smells like sap and mushrooms.\\n\\nI have once again looked at the very large space offered and opted to block off 90% of the house for Small.',['N']='Hjaalmarch Hideaway',['O']=19099,},[19]={['C']=1.500000,['D']='-shoves vines everywhere- this is very structurally sound. also i forgot to change the visitor perms last time ^^;',['N']='Kragenmoor House',['O']=19064,},[23]={['C']=1.500000,['D']='Just north of Rawl\\'kha lies Sleek Creek Shelter \\nA place of rest owned by Clanmother Jo\\'Taska and open for any and all who need a place to stay, be it temporary or slightly more permanent. \\nShe does not charge for the time spent, the only thing she asks is you help keep the place tidy.\\n\\nFeatures: My maybe unhealthy obsession with vines and rugs. \\n\\nMulti-house build, there\\'s a portal leading to Jo\\'Taska\\'s room inside, I havent uploaded it but it should still be accessible',['N']='Sleek Creek Shelter',['O']=19184,},[31]={['C']=1.500000,['D']='Not enough space in the inn room for your decorating needs? NO PROBLEM just rebuild it somewhere else',['N']='Gonfalon Inn... 2!',['O']=19290,},[37]={['C']=1.026000,['D']='A long forgotten dwemer tower renovated and given life once more.\\n\\nAlternate title: Sunflower House',['N']='Hidden Sun Outpost',['O']=19463,},[70]={['N']='Lion\\'s Outpost',['O']=18499,},[87]={['C']=1.037000,['D']='sit down in the wheat and simply exist within the cabbig temple.',['N']='cabbage my beloved',['O']=18874,},[13]={['C']=1.026000,['D']='a reskin of snugpod to what could possibly pass as an inn room in scenic fargrave\\nAccomodations for a vampiric occupant with built in Anti-Xivilai security systems!\\nSimply turn the mirror towards them before they reach the stairs and try to escape before they shatter it into tiny pieces and decide your fragile mortal form is next!',['N']='Fargrave Appartment',['O']=19075,},[63]={['C']=1.500000,['D']='The Hideaway of my healer and @name holder Rivathyn, stored neatly away on a shelf in Lions Outpost and reserved for when people are too much to handle or immediately after Midyear Mayhem.\\n\\nThe basement is accessible and holds Secrets if you feel like climbing on things',['N']='Snome',['O']=18921,},},['TS']=1718582505,['Key']='oh__@rivathyn',['Version']=1773,}"
