R["oh__@ofelianox"]="{['TS']=1713102649,['Key']='oh__@ofelianox',['eu']={[33]={['N']='Zur liebenden Mutter',['D']='This Restaurant is so good, you may stay here for ever',['C']=1.013000,['O']=19827,},[3]={['N']='Simple Guestroom',['D']='Just a plain and small simple room. Perfekt for relaxing.',['C']=1.049000,['O']=19827,},[102]={['N']='Angelclub e.V',['D']='The Guildhall of the famous Angelclub Tamriel e.V It\\'s just awesome!',['C']=1.010000,['O']=19827,},[71]={['N']='ancient Greek town',['D']='an ancient greek Town with Temples, a Coliseum and some mysteries to uncover',['C']=1.029000,['O']=19827,},[73]={['N']='Haus in Senchal',['D']='In this Brothel, we do everything you want. Come in, and bring some Gold with you Darling.',['C']=1.028000,['O']=19827,},[13]={['N']='Fairytown',['D']='Some strange fairy Creatures settled down in this cute bud. Maybe you can see them if you take a close look. But be carefull, they\\'re very shy.',['C']=1.020000,['O']=19827,},[79]={['N']='Vampirkastell',['D']='A Wizardschool set in a Huge Castle? A Dude with Glasses and a Scar on his Forhead? Strange deadly Puzzles, defenitly not for Children? What could this Place be? ',['C']=1.020000,['O']=19827,},[80]={['N']='Christmastown',['D']='Ho Ho Ho. You want to go where Santa lives? Now you have the chance to see his Home, his Slay and even his Workshop. ',['C']=1.022000,['O']=19827,},[15]={['N']='Easteregg Factory',['D']='Visit the Place, where the Easterbunny is doing his magic. Maybe you Manage to find all the Easterbaskets hidden by the Easterbunny himself just for you.',['C']=1.022000,['O']=19827,},[7]={['N']='Out of a Fairytale',['D']='A Tower withour an Entrance, deep in the Woods. It only has a Window. And some say they saw a Girl through this Window. A Girl with blonde, extremly long Hair. Strange',['C']=1.020000,['O']=19827,},[70]={['N']='Wedding-Temple',['D']='You want to get married to your Loved one? Rent the Weddinghall. Visit today, Marry tomorrow!\\n(It\\'s lovely here)',['C']=1.016000,['O']=19827,},[89]={['N']='Kapelle in Dunkelforst',['D']='Some Goods can only deliverd by ship. By Airship!',['C']=1.015000,['O']=19827,},[38]={['N']='Magnotta Estate',['D']='The Magnotta Estate Welcomes you. If you have the Money, you even can get married at this beautiful Estate.',['C']=1.021000,['O']=19827,},[56]={['N']='Teahouse',['D']='Come to our private, secret, hidden, japanese style Teahouse. Sit down, lets have a calm chat and drink some lovely tea. ',['C']=1.051000,['O']=19827,},[25]={['N']='The deep Sea',['D']='A long forgotten Ship laying at the bottom of the deep Sea. Maybe there is Treasure?',['C']=1.015000,['O']=19827,},[26]={['N']='The Cute Tailor',['D']='You want a new Dress? Visit the Cute Tailor. Finest Silk. Best Clothes in Tamriel. Just stop by and have a look yourself  :)',['C']=1.050000,['O']=19827,},[58]={['N']='Ritualside',['D']='There are some spooky Rituals going on here',['C']=1.023000,['O']=19827,},[28]={['N']='Catty Christmas',['D']='So what could probably happen if i go shopping and leave the cats at home alone... with the Christmastree...And the Candles...',['C']=1.022000,['O']=19827,},[47]={['N']='Eiland in Kalthafen',['D']='Alice followed the white Rabbit and you can now follow Alice deep into the Rabbithole of The Wonderland',['C']=1.020000,['O']=19827,},[62]={['N']='Ofelias Retreat',['D']='Welcome to Ofelias Retreat. You can read at the Library, enjoy the tasty food and do so many more grat things here. And after your stressfull day ends you can relax in the steam bath',['C']=1.021000,['O']=19827,},[63]={['N']='Christmasmarket',['D']='Enjoy this cosy and friendly Christmasmarket. We wish you happy Holidays.',['C']=1.022000,['O']=19827,},},['Version']=1773,}"
