,['SizeZ']=672,['Alpha']=1,['SizeX']=414.285714,['Y']=10291,['Groups']=0,['Roll']=0,['Z']=29675,['Id']=2871,['Yaw']=4.712389,['Contrast']=1,},[230]={['Color']=31700,['Pitch']=1.570971,['EffectType']=829,['SizeY']=1240,['X']=20192,['SizeZ']=1240,['Alpha']=1,['SizeX']=2560,['Y']=9624,['Groups']=0,['Roll']=0,['Z']=35870,['Id']=3599,['Yaw']=0,['Contrast']=1,},[231]={['Color']=31500,['Pitch']=1.570971,['EffectType']=829,['SizeY']=1240,['X']=19577,['SizeZ']=1240,['Alpha']=1,['SizeX']=2560,['Y']=9664,['Groups']=0,['Roll']=0,['Z']=34944,['Id']=3600,['Yaw']=0,['Contrast']=1,},[232]={['Color']=21300,['Pitch']=1.570971,['EffectType']=829,['SizeY']=1240,['X']=19259,['SizeZ']=1240,['Alpha']=1,['SizeX']=2560,['Y']=9724,['Groups']=0,['Roll']=0,['Z']=35454,['Id']=3601,['Yaw']=0,['Contrast']=1,},[233]={['Color']=41500,['Pitch']=1.570971,['EffectType']=829,['SizeY']=1240,['X']=19363,['SizeZ']=1240,['Alpha']=0.950000,['SizeX']=2560,['Y']=9704,['Groups']=0,['Roll']=0,['Z']=36494,['Id']=3602,['Yaw']=0,['Contrast']=1,},[234]={['Pitch']=4.712564,['Color']=33591,['SizeY']=47,['EffectType']=8503,['SizeZ']=47,['X']=13034,['SizeX']=40,['Alpha']=1,['Y']=10633,['MetaData']={['message']='\\nWelcome! \\n\\n\\nThis is a house I had originally created for a quest for our RP guild. I have since, made adjustments, so visitors to the house can also enjoy a little hint of the adventure they had!\\n\\n\\nThere are lots of spooky little nasties hiding for you to find! So keep a sharp eye out! \\n\\n\\n***\\n(If you wish to simply look around without any story, feel free to skip reading the remaining books, and just enjoy yourself. :-) )\\n\\n\\n\\n----------------------------------\\n\\n\\n\\nThose seeking the adventure:\\n\\nThere will be a few books you can find throughout this adventure.\\n\\nWatch for:\\n\\nOrange books under pumpkins: These are narrative information, that will guide you through the story\\'s progression. (7)\\n\\n*There is one journal on a desk nearby that could prove both amusing, and useful. (1)\\n\\nThere will be a few books on shelves you can find, but they are not essential to the story at all. Just simply Easter egg books with information about the land, people, faith or flora and fauna of the underdark. (I hope to continuously add more and more as time  goes by.)\\n\\nI hope you enjoy, and .. Happy Halloween!!\\n\\n(Don\\'t forget to read the first story book before going though the portal!)\\n\\n',['title']='Introduction- Please read',},['Groups']=0,['Roll']=0,['Z']=39319,['Id']=3605,['Yaw']=4.447099,['Contrast']=0.750000,},[235]={['Pitch']=4.712564,['Color']=194574,['SizeY']=30,['EffectType']=8502,['SizeZ']=30,['X']=15240,['SizeX']=21.456456,['Alpha']=1,['Y']=10583,['MetaData']={['message']='House Nilvala has requested my aid to connect them with a wizard from the surface. They have even gone so far as to embrace the surface\\'s dark holiday, to welcome this wizard. \\n\\n\\nI have chosen to send Mortali, an insufferable, pompous fool I have had the displeasure of working with before. He is quite skilled, just as requested, but I\\'m hoping his mouth might get house Nilvala to rid me of him permanently. We shall see.\\n\\n\\nMortali arrived today. I quickly sent Beilon to guide him out before I killed him myself. I had them go through the breakroom and out the back into the Underdark. \\n\\n\\nThey\\'ll have to keep to the upper pathway to the left, since poisonous gasses have built back up blocking the lower path. There are many dangers between here and the secret tunnel that leads into the library of house Nilvala. Perhaps he\\'ll never even make it to the house ... such a pity.\\n\\n\\nWe have sensed multiple magical attempts of scrying, from Tamriel, allies of Mortali I am sure. Let them come and seek him out... We will allow them to pass for now. .... after all, this could be quite amusing to watch.\\n\\n\\nAn ally of Mortali came today through a portal. From above, we watched him look around my office. ... He did not make it very far once he entered the Underdark. \\n\\n\\nToday they sent two allies of Mortali. For such a irritating human, they are persistent in finding him. They almost found the secret door, but got sidetracked by the emeralds to the North. ... Basilisks do not like to be disturbed. \\n\\n\\nAnother comes today...  We will be watching....',['title']='Jarlaxle\\'s log',},['Groups']=0,['Roll']=0,['Z']=41493,['Id']=3606,['Yaw']=3.471460,['Contrast']=1.500000,},[236]={['Color']=999999,['Pitch']=4.712564,['EffectType']=4,['SizeY']=280,['X']=13573,['SizeZ']=280,['Alpha']=1,['SizeX']=1080,['Y']=10999,['Groups']=0,['Roll']=0,['Z']=39658,['Id']=3607,['Yaw']=4.028220,['Contrast']=1,},[237]={['Color']=0,['Pitch']=0,['EffectType']=12,['SizeY']=1,['X']=30726,['SizeZ']=500,['Alpha']=1,['SizeX']=500,['Y']=10241,['Groups']=0,['Roll']=0,['Z']=29673,['Id']=3608,['Yaw']=4.747296,['Contrast']=1,},[238]={['Color']=241900,['Pitch']=1.570971,['EffectType']=829,['SizeY']=2720,['X']=29225,['SizeZ']=2720,['Alpha']=1,['SizeX']=1320,['Y']=10624,['Groups']=0,['Roll']=0,['Z']=32760,['Id']=3611,['Yaw']=0.015708,['Contrast']=1,},[239]={['Pitch']=3.141767,['Color']=530100,['SizeY']=192.982456,['EffectType']=847,['SizeZ']=192.982456,['X']=29356,['SizeX']=470,['Alpha']=0.040000,['Y']=10105,['MetaData']={['pattern scale % (x)']=100,['pattern scale % (y)']=100,},['Groups']=0,['Roll']=0,['Z']=30295,['Id']=3613,['Yaw']=0.261799,['Contrast']=1,},[240]={['Color']=0,['Pitch']=4.712564,['EffectType']=5053,['SizeY']=540,['X']=29330,['SizeZ']=540,['Alpha']=1,['SizeX']=94.669405,['Y']=10028,['Groups']=0,['Roll']=0,['Z']=29729,['Id']=3619,['Yaw']=0.048869,['Contrast']=1.320000,},[241]={['Color']=19,['Pitch']=4.708898,['EffectType']=832,['SizeY']=580,['X']=29543,['SizeZ']=580,['Alpha']=1,['SizeX']=242,['Y']=9936,['Groups']=0,['Roll']=0,['Z']=30264,['Id']=3620,['Yaw']=4.680973,['Contrast']=0.620000,},[242]={['Color']=0,['Pitch']=4.712564,['EffectType']=5090,['SizeY']=50,['X']=29410,['SizeZ']=50,['Alpha']=1,['SizeX']=49.