R["oh__@inkama"]="{['Version']=1773,['Key']='oh__@inkama',['na']={[18]={['D']='A confy place to live. Two bedroom, one full bath, well stocked kitchen, treasure vault,  lovely garden with water feature. Nice Library/study.  ',['C']=1.051000,['O']=19330,['N']='Wayrest House',},[62]={['D']='Worked to make all of the garden appeared it belonged to the villa.  Cleaned up the paths and added color.',['C']=1.021000,['O']=19210,['N']='Harmony Gardens',},[98]={['D']='My island home.  Did my best to make it look like the house belongs there. ',['C']=1.018000,['O']=19496,['N']='Systres Lighthouse',},[11]={['D']='The house of Wisdom.  While not completely done, it is complete enough to show.  ',['C']=1.025000,['O']=19508,['N']='Stormhold House',},[90]={['D']='There was a crooked man, and he walked a crooked mile, He found a crooked sixpence against a crooked stile; He bought a crooked cat which caught a crooked mouse, And they all lived together in a little crooked house.\\nContain an Aims Room.',['C']=1.040000,['O']=19448,['N']='A Crooked House',},[2]={['D']='Small studio appartment with the single adventurer in mind.  Complete with stove, shower, toilet, and lots of books. ',['C']=1.051000,['O']=19581,['N']='Daggerfall Inn',},[14]={['D']='A druid temple on top of a rocky craig. ',['C']=1.037000,['O']=19567,['N']='Longhaven House',},[10]={['D']='Two story rebuild of the tiny Humblemud.  Inspired by a simular build by @Nikkojii (tried not to copy her).  Enjoy.',['C']=1.051000,['O']=19387,['N']='Dhalmora House',},},['TS']=1691817412,}"
