R["oh__@perdita"]="{['eu']={[32]={['O']=19366,['C']=1.026000,['D']='The home of an ord retired after a life of adventuring in Craglorn.',['N']='Halcyon House',},[36]={['O']=19366,['C']=1.018000,['D']='An argonian coastal village with a harbor, huts, fishing and a hidden xanmeer temple.',['N']='Port Hunding House',},[38]={['O']=19366,['C']=1.021000,['D']='',['N']='Daenia Dolmen Manor',},[71]={['O']=19366,['C']=1.016000,['D']='Rainbow Festival',['N']='Elsweyr Meadow',},[40]={['O']=19366,['C']=1.018000,['D']='A coastal village for merchant and farm life, with a tavern that has inn rooms for both rich and poor, as well as a secret sewer entrance.',['N']='Topal Bay Island',},[41]={['O']=19366,['C']=1.026000,['D']='Riverwood from Skyrim',['N']='Craglorn Estate',},[42]={['O']=19366,['C']=1.031000,['D']='A smol argonian marshland.',['N']='Vivec City Inn',},[43]={['O']=19366,['C']=1.042000,['D']='A castle style old mansion.',['N']='Hlaalu Home',},[13]={['O']=19366,['C']=1.019000,['D']='A Bosmer School of the Green Pact',['N']='Elden Root House',},[15]={['O']=19366,['C']=1.026000,['D']='Skyhold from Dragon Age Inquisition',['N']='Cormount House',},[48]={['O']=19366,['C']=1.027000,['D']='A mad scientists laboratory. What are they studying? Go up the scaffolding to view in the giant microscope...',['N']='Falkreath Hall',},[81]={['O']=19366,['C']=1.021000,['D']='A nord farmland and hall of feasts.',['N']='Hjaalmarch Gallery',},[7]={['O']=19366,['C']=1.014000,['D']='A romantic getaway in Mara\\'s spirit',['N']='Black Vine House',},[62]={['O']=19366,['C']=1.037000,['D']='This overgrown ancient building has recently seen new life after a healer cult of khajiit, argonians and elves led by a high elf woman moved into the ruins and started renovating the mostly overgrown grounds. A dock with merchants have established, and inside they take on those at the end of their life for prayer and medications (why so many dried lizards and frogs in the kitchen, and is that skooma in that smoking room?), and when those visitors pass away they are sent away by sea.',['N']='Artaeum Manor',},[16]={['O']=19366,['C']=1.047000,['D']='A smol cottage.',['N']='Daggerfall House',},[57]={['O']=19366,['C']=1.010000,['D']='The Guild House of Tamriel Women Unite',['N']='Abah\\'s Landing Manor',},[70]={['O']=19366,['C']=1.023000,['D']='An apocalyptic sewer system. Who is squatting here? Enter at your own peril...',['N']='Rimmen Temple',},[39]={['O']=19366,['C']=1.023000,['D']='Something went wrong with the magical ritual and the volcano erupted. Now the landscape is barren and only ashlanders remain.',['N']='Ebonheart Manor',},[28]={['O']=19366,['C']=1.036000,['D']='A cozy christmas cottage',['N']='Nimalten House',},[10]={['O']=19366,['C']=1.023000,['D']='A completely insconspicous cottage...',['N']='Dhalmora House',},[30]={['O']=19366,['C']=1.026000,['D']='The home of my main nord nightblade tank Unun',['N']='Riften House',},[47]={['O']=19384,['C']=1.021000,['D']='For the Tamriel Homes\\' PCEU Housing Competition \"Gardens\". \"Lost Creature Secret Garden. Passing through Nirn, it carries a garden sanctuary. Where did it come from, and where is it going?\"\\n\\r\\n\\r\\n',['N']='Coldharbour Island',},},['Version']=1771,['Key']='oh__@perdita',['TS']=1674833399,}"
R["fx__na__@plushiesaur__38"]="{['Version']=1771,['TS']=1674738450,['Effects']={[1]={['Roll']=0,['Contrast']=0.850000,['X']=96159.270508,['SizeX']=50,['Color']=576976,['Pitch']=4.712564,['Id']=1001,['Y']=4670.764706,['SizeY']=73.529412,['SizeZ']=73.529412,['EffectType']=600,['Groups']=0,['Z']=61009.137344,['Yaw']=2.701770,['Alpha']=1,},[2]={['Roll']=0,['Contrast']=1.250000,['Color']=547,['SizeX']=36.456456,['MetaData']={['title']='On Harrowstorms',['message']='by Fennorian of House Ravenwatch\\n\\nThese notes will one day become a treatise on the subject of harrowstorms and the magic behind it, provided I find the time to eventually turn them into something of publishable quality.\\n\\nHarrowstorms are arcane weather events created from a mix of Icereach Coven magic and ancient vampiric alchemy. They strike without warning, leaving death and worse in their wake. I have seen the devastation left behind by these supernatural storms. The forces called forth can kill or transform the living caught within them into near-mindless shells we\\'ve come to call the harrowed, though some become a new kind of feral vampire we now refer to as harrowfiends. Of course, not everyone exposed to the storms suffers from one of these afflictions, but I have yet to determine any rhyme or reason as to who dies, who transforms, and who walks away unscathed.\\n\\nAs I continue my research into the phenomenon, I can say with some certainty that the harrowstorms are created via some sort of Reach magic ritual. The ritual uses various arcane components, including some sort of fetish or totem, and an alchemical mixture, in addition to a ritualistic chant to focus and unleash the magic.\\n\\nI still have no idea whether the resulting afflictions represent the ultimate goal of the harrowstorms or if they are just an unfortunate result of some more insidious purpose. Nor do I know for certainty who is behind the supernatural events. More research is required to determine how the storms go about killing or transforming their victims, and whether or not there may be a way to restore what was taken from them. Time will tell.',},['X']=97536.425067,['Pitch']=4.712564,['Id']=1014,['Y']=6467,['SizeY']=50,['SizeZ']=50,['EffectType']=8502,['Groups']=0,['Z']=58402.487083,['Yaw']=2.080432,['Alpha']=1,},[3]={['Roll']=0,['Contrast']=1,['X']=90210.448246,['SizeX']=34,['Color']=999999,['Pitch']=4.712564,['Id']=1017,['Y']=16423.080292,['SizeY']=48.160584,['SizeZ']=48.160584,['EffectType']=598,['Groups']=0,['Z']=53953.366424,['Yaw']=3.881612,['Alpha']=1,},[4]={['Roll']=0,['Contrast']=0.990000,['X']=96733.715042,['SizeX']=50,['Color']=777986,['Pitch']=4.712564,['Id']=1019,['Y']=4578.764706,['SizeY']=68.529412,['SizeZ']=68.529412,['EffectType']=600,['Groups']=0,['Z']=58428.813122,['Yaw']=5.976007,['Alpha']=1,},[5]={['Roll']=0,['Contrast']=1,['Color']=102439,['SizeX']=46.456456,['MetaData']={['title']='To my dear friend',['message']='Verandis,\\n\\nI know that your ceaseless quest to appease and coddle the mortals takes a great deal of your time, but I must insist that you take a brief respite from your work to come visit the great castle we erected in your absence. It truly is magnificent. I firmly believe that when the peace we both seek is realized, Grayhome will stand among the wonders of the world. It will be a beacon of hope for our kind and the mortals who serve us. A grand reminder that anything is possible with hard work and vision.\\n\\nYour absence is felt here. The Gray Council rules the Gray Host, but your seat at our table remains empty. Even Exarch Ulfra feels your loss, though she would never admit it. Come, my friend. Visit us at Grayhome. I\\'ve restocked your laboratory with everything you could ever need. I have no doubt that you and Exarch Tzinghalis can complete your research there.\\n\\nI\\'ve drawn a map on the back of this letter to guide you to the island. Return to us, Verandis. Return to the Gray Council, to your family, and to your home.\\n\\nYour beloved brother,\\nRada al-Saran',},['X']=96161.466301,['Pitch']=4.799655,['Id']=1020,['Y']=4672,['SizeY']=50,['SizeZ']=50,['EffectType']=8502,['Groups']=0,['Z']=61002.649529,['Yaw']=2.670354,['Alpha']=0,},[6]={['Roll']=0,['Contrast']=1,['Color']=102439,['SizeX']=46.456456,['MetaData']={['title']='Concerning the maps',['message']='Gwendis,\\n\\nThis one appreciates your enthusiasm in regards to your scouting missions, but tossing the maps around and poking holes in them is a bit too much, yes? Please, have some respect for our resources. \\nAll I can do with Vvardenfell right now is to use it as kindling!\\n\\nAdusa',},['X']=96734.013054,['Pitch']=1.570971,['Id']=1021,['Y']=4577,['SizeY']=70,['SizeZ']=70,['EffectType']=8502,['Groups']=0,['Z']=58428.854101,['Yaw']=2.809980,['Alpha']=0,},[7]={['Roll']=0,['Contrast']=1,['Color']=102439,['SizeX']=46.456456,['MetaData']={['title']='List of orders',['message']='Athelas,\\n\\nWhile I was in town, I gathered a few more orders for your crafts! Here they are:\\n\\n-\\'egg\\' lamp\\n-three lidded baskets\\n-wind chimes (add lots of colours - it\\'s for Lalis\\'s new baby!)\\n\\nThere is no rush, so work at your own pace - we will arrange a courier back to Hoarfrost Downs once everything is ready.\\n\\nSee you soon,\\nMelina\\n\\nPS: I\\'m bringing a batch of fresh, delicious pumpkins, just for you!',},['X']=90211.509093,['Pitch']=1.570971,['Id']=1022,['Y']=16421,['SizeY']=30,['SizeZ']=30,['EffectType']=8502,['Groups']=0,['Z']=53954.497161,['Yaw']=5.415757,['Alpha']=0,},[8]={['Roll']=0,['Contrast']=0.970000,['X']=91263.440900,['SizeX']=50,['Color']=868799,['Pitch']=4.712564,['Id']=1023,['Y']=14175.339806,['SizeY']=60.679612,['SizeZ']=60.679612,['EffectType']=599,['Groups']=0,['Z']=57259.379654,['Yaw']=5.733407,['Alpha']=1,},[9]={['Roll']=0,['Contrast']=1,['Color']=102439,['SizeX']=46.456456,['MetaData']={['title']='Kallin\\'s letter',['message']='Dear Mother,\\n\\nI am glad to hear things at home are well. I will be joining you for the upcoming celebration as usual - expect me to arrive before Hearthfire ends.\\n\\nI know some of the rumours concerning my employers have you concerned for my current lifestyle. Pay no mind to these - there is nothing untoward about what I do, I assure you. \\n\\nCount Verandis Ravenwatch is a kind, caring master and his wards follow suit. They provide for my every need, ensure my safety and treat me well. I can scarcely imagine a better place for myself.\\n\\nDiscretion is highly valued at House Ravenwatch however, so let us not return to this topic again.\\nBe well and give my warmest regards to Father. \\n\\nYours truly,\\nKallin',},['X']=91263.998549,['Pitch']=4.712564,['Id']=1026,['Y']=14174,['SizeY']=50,['SizeZ']=50,['EffectType']=8502,['Groups']=0,['Z']=57259.847802,['Yaw']=5.712463,['Alpha']=0,},},}"
