R["oh__@bluebearynd"]="{['TS']=1674696422,['na']={[95]={['O']=19253,['N']='Pirate\\'s rest',['C']=1.007000,['D']='30/30 items decorated with the idea that this is the inn-room for BlueBearyND\\'s male toon whom is a sailor and from High Isle. Ezabi, dye station and armoury station available if just looking for a quick place to port! ',},[74]={['O']=19360,['N']='Seyrene\\'s Party BYB',['C']=1.013000,['D']='Come party with Seyrene! \\nParty is out back BYB ',},[71]={['O']=19318,['N']='Crafting Meadow',['C']=1.009000,['D']='@BlueBearyND\\'s Crafting Meadow.\\nThere are also target dummies, aetherial well, 7 mundas & vampire amenities. Everyone is welcome to use. alphabetical from left to right',},[4]={['O']=19261,['N']='Daedric Vet Office',['C']=1.019000,['D']='have a daedric pet in need of emergency care? Bring them over to the Barbed Hook private room in Skywatch for a quick fix! ',},[13]={['O']=19253,['N']='Serene decon hut',['C']=1.051000,['D']='BlueBeary\\'s snugpod is an adventurer\\'s serene rest stop. Dye station, Trasnmute station, Gharsharog, Giladel, Banker/Merchant available right by the door. Up the stairs is basic stations. Outside is an Outlaw refuge, stable master, undaunted enclave, tot tent, mages guild, fighter\\'s guild up in elden root, Master Writ turn in over the bridge. thank you for visiting!',},[63]={['O']=19330,['N']='New Life Retreat',['C']=1.022000,['D']='Welcome to Zyssia\\'s New life festival retreat! Basic crafting stations for writs, assistants close to door, dye table & transmutation station for convience! Outside take a serene snowy walk with M\\'aiq or head inside for a snack and warm rest, happy holidays',},[23]={['O']=19383,['D']='Before Aza Silver-Paws became a Clan Mother she enjoyed a simple life hosting parties at her Sleek Creek estate. Here you will find everything a young khajiit needs inbetween battlegrounds. Lots of food and cosiness here!',['C']=1.007000,['N']='Aza\\'s home',},},['Key']='oh__@bluebearynd',['Version']=1771,}"
