R["oh__@cyanea"]="{['Key']='oh__@cyanea',['eu']={[15]={['N']='Enchanted Forest',['C']=1.026000,['D']='This land once belonged to a tribe of feral werewolves, who worshipped Hircine and performed bloody rituals in his honor. Now it became a home for group of bosmers and reconciled with the rest of Valenwood, rightfully returning under Y\\'ffre\\'s wing. The remnants of vicious ways of previous inhabitants, though, can still be discovered here.',['O']=19085,},[36]={['N']='Sun-Kissed Retreat',['C']=1.026000,['D']='Far away from the burstle of cities, on a secluded island lies a redguard-styled mansion, which belongs to a wealthy treasure hunter. But ones should be beware of seeking to steal  riches from there - you won\\'t wish to be at odds with the house\\'s guardian.',['O']=19095,},[59]={['N']='Manor \"Regale Lily\"',['C']=1.051000,['D']='Traditional high elf home, adorned with flowers and statues, is just one more proof of the fact that none of other races value the beauty more than altmers do.\\r\\nP.S. Please, do not trust the cats. They have beeen FED.',['O']=19073,},[38]={['N']='The Vampire`s Lair',['C']=1.048000,['D']='Greetings, my dear unwilling guest! Tonight we honor our father, Lord of Brutality, and our mother, Blood-Matron, and your presence is very much welcomed. Enjoy the festive dinner, for it shall be your last one.\\r\\nHave a good look at my mansion. Appreciate its dark beauty. Make sure there is no escape.',['O']=19243,},[55]={['N']='Apostle`s Hideout',['C']=1.027000,['D']='Home of a young aposltle, who is devoted to uncovering the mystery of the dwemers\\' disappearance. Contains living accomodations along with laboratory, smithy, library, factotums\\' quaters and fabricant garden.',['O']=19109,},[88]={['N']='Leyawiin Bridge Home',['C']=1.051000,['D']='Baths, a vineyard, a sanctuary of the Eight Divines -- this townhouse is the epitome of imperial living.',['O']=19034,},[9]={['N']='Abandoned Mansion',['C']=1.025000,['D']='The previous owner of this house was a noble altmer, who was known for his passion for everything ayleid, and, therefore, as the one who tended to rob ayleid ruins. They say, some ancient curse eventually got him, so he disappeared, and the house was left hidden and unattended for several centuries. Until a psijic order member accidentally unveiled it. Now she stays in there, exploring and studying massive library of ancient books the nobleman managed to collect.',['O']=19138,},[24]={['N']='Catspaw Estate',['C']=1.051000,['D']='An elsweyr-styled house belonging to a khajiiti th... merchant with an ancient anequina temple nearby.',['O']=19063,},[75]={['N']='Juniper Village',['C']=1.026000,['D']='A small orc craftsmen settlement peacefully coexisting with a reachfolk camp nearby.',['O']=19247,},[12]={['N']='Remnant of Xanmeer',['C']=1.026000,['D']='Ruined Xanmeer, swamp and abondened Sithis\\'s shrine - this place wasn\\'t exactly habitable till a newly arrived argonian made it into comfortable traditional home to be proud of. Just don\\'t go to the backyard, for your own good.',['O']=19068,},[43]={['N']='Fungal Manor',['C']=1.026000,['D']='A traditional dark elf mansion built for a dunmeri Minor House, Velori.',['O']=19037,},[78]={['N']='Thane\\'s House',['C']=1.026000,['D']='Ragnhild is a nice host. Come, pay her a visit, and she will eagerly demonstrate you her house and treat you with delicacies and home-brewed mead. Just don\\'t ask any questions about a small room downstairs, which is closed for guests. Let the sleeping dogs lie. In the end, a lady should have her own little mysteries, shalln\\'t she?',['O']=19103,},[63]={['N']='Tavern \"Kyne\\'s Wind\"',['C']=1.024000,['D']='Once a chapel of the Eight, now a classy tavern, where anyone can full their bellies with mead and find a company for playing a round of Tales of Tributes. Blasphemy? Unlikely! A breton woman, who owns this establishment, tells the visitors that this place still holds blessing of the Gods, and any food eaten here brings good fortune to a customer for the folloiwing day.\\r\\nBelieve this or not, it still doesn\\'t change the fact that \"Kyne\\'s Wind\" has the most delicious meals and the softest beds.',['O']=19174,},},['TS']=1662975828,['Version']=1769,}"
