'X']=116995.810846,['SizeX']=42.456456,['Z']=103173.257467,['Groups']=0,['Alpha']=1,['EffectType']=8502,['Yaw']=4.363323,['Roll']=0,['Pitch']=0,['Y']=27531,['MetaData']={['title']='Sparring: Volume II How to Play',['message']='**__How to play__**\\n(All will use Inn gear and weapons to keep a focus on skills)\\n\\nPick your team: Blue Moon or Golden Sun\\n\\nList your advantage or disadvantage points so all can make sure the match is fair with the right points being added or subtracted. \\n*Example: (Vampire  Highly skilled +2  Swordsmen  Skilled +1 ) +3\\nor\\nExample: (Farmer) +/-\\nor\\nExample (Blind) -1 ',},['SizeY']=54,},[35]={['Id']=2793,['Color']=102439,['SizeZ']=54,['Contrast']=2.060000,['X']=117008.961677,['SizeX']=42.456456,['Z']=103250.214639,['Groups']=0,['Alpha']=1,['EffectType']=8502,['Yaw']=5.497787,['Roll']=0,['Pitch']=0,['Y']=27421,['MetaData']={['title']='Sparring: Volume III Turns',['message']='**__Turns__**\\n*All rolls in discord*\\n\\nYou and your opponent roll __!r 1d20__ to see who goes first. Highest roll goes first.  \\n\\nPlayer One: Name your counter move then roll __!r 1d20__\\n\\nPlayer Two: Name your counter and roll __!r 2d20__ \\n*Here, player two will pick what roll gets the boosts available and what roll the counter is.*\\n\\nPlayers RP what happens. __A point is given to the winner__\\n\\nPlayer One: Second roll that was not used as a counter is your roll now. Name your move. \\n\\nPlayer Two: Name your counter and roll __!r 2d20__ \\n*Here, player One will pick what roll gets the boosts available and what roll the counter is.*\\n\\nThe game will continue until someone wins 5 encounters.',},['SizeY']=54,},[36]={['Id']=2794,['Color']=102439,['SizeZ']=54,['Contrast']=2.100000,['X']=117004.912673,['SizeX']=42.456456,['Z']=103208.743349,['Groups']=0,['Alpha']=1,['EffectType']=8502,['Yaw']=1.672025,['Roll']=0,['Pitch']=0,['Y']=27420,['MetaData']={['title']='Sparring: Volume IV Points',['message']='**__Points__**\\n\\nTies: Ties are anything 1 or less points off. Neither gains or loses a point.\\n\\n20 or + Rolls: Gives the other side a -1 on one of their rolls until healed. \\n\\n1 or minus rolls: Gives you a -1 on one of your rolls until healed. \\n\\nYou gain a point when you are more than 2 role points ahead. RP wise, this means the other knocked you to your back.\\n\\nGetting healed: Gives the other side a point. ',},['SizeY']=54,},[37]={['Id']=2795,['Color']=102439,['SizeZ']=54,['Contrast']=2.080000,['X']=117000.144529,['SizeX']=42.456456,['Z']=103164.729709,['Groups']=0,['Alpha']=1,['EffectType']=8502,['Yaw']=1.308997,['Roll']=0,['Pitch']=0,['Y']=27420,['MetaData']={['title']='Sparring: Volume V Tips',['message']='**__Suggestions__**\\nHave healers on standby!\\n\\n**__Notes__**\\nPlay fair! No one wants to spar with others who are trying to cheat, be overpowered or are generally not fun.\\n\\nInn arena battles play by the Inn\\'s arena rules. Battles elsewhere may have their own mechanics.',},['SizeY']=54,},},['TS']=1660612053,}"
