R["oh__@lynoctis"]="{['na']={[16]={['O']=19014,['N']='Crash Pad',['D']='A cozy home-away-from-home for the weary adventurer. ',['C']=1.051000,},[34]={['O']=19016,['N']='Bangkorai Outpost',['D']='This cozy desert fortress creates an intimate nook for you and your guests to enjoy good food and company on the cool Bangkorai nights. And only steps away from Hallin\\'s Stand\\'s banging club scene.',['C']=1.051000,},[63]={['O']=19025,['N']='New Life Snow Globe',['D']='',['C']=1.036000,},[28]={['O']=19014,['N']='Crafting House',['D']='A compact, yet aesthetically-pleasing, crafting house, arranged close for maximum convenience.',['C']=1.500000,},[38]={['O']=19014,['N']='Gingerwood',['D']='Hidden behind a secret door in the basement lies a swank resort suspended above the sea! Perfect for entertaining guests, and to impress!',['C']=1.021000,},[70]={['O']=19016,['N']='Warrior\\'s Hideaway',['D']='A posh paradise perfect for a hero who\\'s looking to recharge and relax! The property touts indoor and outdoor sleeping accomodations, private open-air couple\\'s bathing, a moon sugar winery using locally-sourced cane, statues, waterfalls, and...the Madgod\\'s own cheese!\\n\\nWhat happens in left portal stays in left portal, though...',['C']=1.021000,},[31]={['O']=19079,['N']='The Bunkhouse',['D']='You\\'ve heard of Airbnb, but how about Orcbnb?  This luxury bunkhouse in Stormhaven sleeps 8 humans, or 4 average-sized Orcs. Take a toasty bath next to the woodstove after you bash some skulls in at the local arena! With a bread oven and fully-stocked kitchen, you will not go hungry! Keldora will make sure of it. No, really. Don\\'t argue. Just eat.',['C']=1.051000,},},['Version']=1767,['TS']=1648488733,['Key']='oh__@lynoctis',}"
