izeY']=9.500000,['EffectType']=5152,['Id']=7101,['SizeX']=11,['Contrast']=1,['MetaData']={['pattern scale % (y)']=10,['pattern scale % (x)']=10,},},[632]={['Groups']=0,['Y']=23555,['Roll']=0,['Alpha']=1,['Yaw']=3.275983,['Pitch']=0,['SizeZ']=9.500000,['X']=127732.765399,['Z']=120798.576906,['Color']=482029,['SizeY']=9.500000,['EffectType']=5152,['Id']=7102,['SizeX']=11,['Contrast']=1,['MetaData']={['pattern scale % (y)']=10,['pattern scale % (x)']=10,},},[633]={['Groups']=0,['Y']=23560,['Roll']=0,['Alpha']=1,['Yaw']=3.275983,['Pitch']=1.570971,['SizeZ']=10.500000,['X']=127732.636549,['Z']=120792.277765,['Color']=391623,['SizeY']=10.500000,['EffectType']=5152,['Id']=7103,['SizeX']=12,['Contrast']=2.580000,['MetaData']={['pattern scale % (y)']=10,['pattern scale % (x)']=10,},},[634]={['Groups']=0,['Y']=23606,['Roll']=0,['Alpha']=1,['Yaw']=2.754130,['Pitch']=4.712564,['SizeZ']=10,['X']=126991.376826,['Z']=120917.045637,['Color']=1600,['SizeY']=10,['EffectType']=4407,['Id']=7107,['SizeX']=23,['Contrast']=1,['MetaData']={['message']='Night\\nBefore\\nChristmas',},},[635]={['Groups']=0,['Y']=23602,['Roll']=0,['Alpha']=1,['Yaw']=2.661627,['Pitch']=4.712564,['SizeZ']=30,['X']=126992.056456,['Z']=120915.638112,['Color']=40099,['SizeY']=30,['EffectType']=8502,['Id']=7119,['SizeX']=27.456456,['Contrast']=1,['MetaData']={['title']='The Night Before Christmas (Part 1)',['message']='by Clement Moore\\n\\n\\n\\'Twas the night before Christmas, when all through the house. Not a creature was stirring, not even a mouse. The stockings were hung by the chimney with care, In hopes that St. Nicholas soon would be there;\\n\\n\\nThe children were nestled all snug in their beds, While visions of sugar-plums danced in their heads; And mamma in her \\'kerchief, and I in my cap,\\nHad just settled down for a long winter\\'s nap,\\n\\n\\nWhen out on the lawn there arose such a clatter, I sprang from the bed to see what was the matter. Away to the window I flew like a flash, Tore open the shutters and threw up the sash. \\n\\n\\nThe moon on the breast of the new-fallen snow Gave the lustre of mid-day to objects below, When, what to my wondering eyes should appear, But a miniature sleigh, and eight tiny reindeer,\\n\\n\\nWith a little old driver, so lively and quick, I knew in a moment it must be St. Nick. More rapid than eagles his coursers they came, And he whistled, and shouted, and called them by name;\\n\\n\\n\"Now, DASHER! now, DANCER! now, PRANCER and VIXEN! On, COMET! on CUPID! on, DONNER and BLITZEN! To the top of the porch! to the top of the wall! Now dash away! dash away! dash away all!\"\\n\\n\\nAs dry leaves that before the wild hurricane fly, When they meet with an obstacle, mount to the sky, So up to the house-top the coursers they flew, With the sleigh full of toys, and St. Nicholas too.\\n\\n\\n\\nAnd then, in a twinkling, I heard on the roof The prancing and pawing of each little hoof. As I drew in my hand, and was turning around, Down the chimney St. Nicholas came with a bound.\\n\\n\\nHe was dressed all in fur, from his head to his foot, And his clothes were all tarnished with ashes and soot; A bundle of toys he had flung on his back, And he looked like a peddler just opening his pack.\\n\\n\\n\\n\\n(Read part 2)',},},[636]={['Groups']=0,['Y']=23602,['Roll']=0,['Alpha']=1,['Yaw']=2.923426,['Pitch']=4.712564,['SizeZ']=30,['X']=126960.873836,['Z']=120897.589864,['Color']=40099,['SizeY']=30,['EffectType']=8502,['Id']=7120,['SizeX']=27.456456,['Contrast']=1,['MetaData']={['title']='The Night Before Christmas (Part 2)',['message']='His eyes -- how they twinkled! his dimples how merry! His cheeks were like roses, his nose like a cherry! His droll little mouth was drawn up like a bow, And the beard of his chin was as white as the snow;\\n\\n\\n\\nThe stump of a pipe he held tight in his teeth, And the smoke it encircled his head like a wreath; He had a broad face and a little round belly, That shook, when he laughed like a bowlful of jelly.\\n\\n\\n\\nHe was chubby and plump, a right jolly old elf, And I laughed when I saw him, in spite of myself; A wink of his eye and a twist of his head, Soon gave me to know I had nothing to dread;\\n\\n\\n\\nHe spoke not a word, but went straight to his work, And filled all the stockings; then turned with a jerk, And laying his finger aside of his nose, And giving a nod, up the chimney he rose;\\n\\n\\n\\nHe sprang to his sleigh, to his team gave a whistle, And away they all flew like the down of a thistle. But I heard him exclaim, ere he drove out of sight, \\n\\n\\nHAPPY CHRISTMAS TO ALL, AND TO ALL A GOOD-NIGHT!',},},[637]={['Groups']=0,['Y']=23606,['Roll']=0,['Alpha']=1,['Yaw']=2.956588,['Pitch']=4.712564,['SizeZ']=12,['X']=126959.383037,['Z']=120899.943281,['Color']=1601,['SizeY']=12,['EffectType']=4407,['Id']=7121,['SizeX']=24,['Contrast']=1,['MetaData']={['message']='Night \\nbefore\\nChristmas',},},[638]={['Groups']=0,['Y']=23627,['Roll']=0,['Alpha']=1,['Yaw']=2.694788,['Pitch']=4.712564,['SizeZ']=5,['X']=126997.688638,['Z']=120906.597769,['Color']=1901,['SizeY']=5,['EffectType']=4407,['Id']=7123,['SizeX']=2,['Contrast']=1,['MetaData']={['message']='1',},},[639]={['Groups']=0,['Y']=23601,['Roll']=0,['Alpha']=1,['Yaw']=3.879867,['Pitch']=0,['SizeZ']=36,['X']=126941.490660,['Z']=120982.741824,['Color']=4203,['SizeY']=36,['EffectType']=8502,['Id']=7125,['SizeX']=27.456456,['Contrast']=1,['MetaData']={['title']='Santa Mouse ',['message']='- by Michael Brown  \\n\\n\\nOnce there was a little mouse, who didn\\'t have a name.\\nHe lived in a great big house, this mouse, \\nthe only mouse in the whole wide house. \\n\\n\\n\\nHe day-dreamed he had playmates who were friendly as could be.\\nThe little girls would bring their dolls, and dress up and have tea.\\nThe boys would play at cowboys or Eskimo or Spanish.\\nBut when he tried to touch them like a bubble they would vanish.\\n\\n\\n\\nNow through the years this little mouse had saved one special thing.\\nA piece of cheese- the kind that makes an angel want to sing.\\nAnd so that night as he brushed his teeth and washed his tiny paws.\\nHe said my goodness no-one gives a gift to Santa Claus.\\n\\n\\n\\nSo he ran to get his piece of cheese and after he had found it,\\nSome paper from some chewing gum he quickly wrapped around it.\\nAnd then he climbed in bed and dreamed that he was lifted high,\\nAnd woke up to find that he was looking right in Santa\\'s eye.\\n\\n\\n\\nThank you for my gift he said now tell me what\\'s your name,\\nI haven\\'t any said the mouse. You haven\\'t that\\'s a shame.\\nYou know I need a helper as I travel house to house.\\nAnd I shall give a name to you, I\\'ll call you Santa mouse.\\n\\n\\n\\nSo here\\'s your beard and here\\'s your suit\\nand here\\'s each tiny shiny boot.\\nYou mustn\\'t sneeze and you mustn\\'t cough,\\nNow put them on and we\\'ll be off.\\n\\n\\n\\nThen over all the rooftops on a journey with no end,\\nAway they went together, Santa and his tiny friend.\\n\\n\\n\\nAnd so this Christmas if you please,\\nBeneath that tree that\\'s in your house,\\nWhy don\\'t you leave a piece of cheese,\\nYou know who\\'ll thank you,\\n\\nSANTA MOUSE!\\n\\n',},},[640]={['Groups']=0,['Y']=23598,['Roll']=0,['Alpha']=1,['Yaw']=3.799582,['Pitch']=6.021386,['SizeZ']=33,['X']=126896.378616,['Z']=120947.264023,['Color']=480300,['SizeY']=33,['EffectType']=8502,['Id']=7126,['SizeX']=17.456456,['Contrast']=1,['MetaData']={['title']='The story behind, Silent Night.',['message']='- Story told by John Denver\\n\\n\\n\\nOn December 24th, 1818, Joseph Mohr, the curator of a small parish in Oberndorf, Austria, gave a poem that he had written to a friend of his, Franz Gruber, who was also the organist and choir director of that church. He asked Mr. Gruber if he would write music for his poem and that he might write it for two solo voices and guitar accompaniment because the organ being broken, he desperately wanted music to be a part of their Christmas Eve service. Mr. Gruber wrote the music a song that has become the most beloved of all Christmas Carols, \\'Sille Nacht\\', in English, Silent Night. \\'Schlaf in himmlisher Rah!\\' ... Sleep in heavenly peace.',},},[641]={['Groups']=0,['Y']=23596,['Roll']=0,['EffectType']=5080,['Z']=120979.945422,['SizeZ']=12,['Alpha']=1,['Yaw']=3.900811,['Color']=393939,['SizeY']=12,['Id']=7127,['Pitch']=0,['SizeX']=18.605042,['Contrast']=1,['X']=126939.824157,},[642]={['Groups']=0,['Y']=23606,['Roll']=0,['EffectType']=612,['Z']=120902.861943,['SizeZ']=7,['Alpha']=0.580000,['Yaw']=5.785766,['Color']=20066,['SizeY']=7,['Id']=7128,['Pitch']=1.570971,['SizeX']=7,['Contrast']=1,['X']=126951.236989,},[643]={['Groups']=0,['Y']=23606,['Roll']=0,['EffectType']=629,['Z']=120890.749243,['SizeZ']=6,['Alpha']=1,['Yaw']=3.207915,['Color']=40,['SizeY']=6,['Id']=7129,['Pitch']=4.712564,['SizeX']=2,['Contrast']=1,['X']=126964.149857,},[644]={['Groups']=0,['Y']=23606,['Roll']=0,['EffectType']=629,['Z']=120889.616813,['SizeZ']=6,['Alpha']=1,['Yaw']=3.207915,['Color']=40,['SizeY']=6,['Id']=7130,['Pitch']=4.712564,['SizeX']=2,['Contrast']=1,['X']=126961.371800,},[645]={['Groups']=0,['Y']=23606,['Roll']=0,['EffectType']=612,['Z']=120919.443851,['SizeZ']=7,['Alpha']=0.580000,['Yaw']=5.785766,['Color']=20066,['SizeY']=7,['Id']=7131,['Pitch']=1.570971,['SizeX']=7,['Contrast']=1,['X']=126982.638268,},[646]={['Groups']=0,['Y']=23606,['Roll']=0,['EffectType']=629,['Z']=120908.769309,['SizeZ']=7,['Alpha']=1,['Yaw']=3.207915,['Color']=40,['SizeY']=7,['Id']=7132,['Pitch']=4.712564,['SizeX']=3,['Contrast']=1,['X']=126994.221059,},[647]={['Groups']=0,['Y']=30000,['Roll']=0,['EffectType']=862,['Z']=121500,['SizeZ']=21000,['X']=126650,['Yaw']=0,['Color']=993109,['SizeY']=21000,['Id']=7134,['Pitch']=0,['SizeX']=23000,['Contrast']=1,['Alpha']=1,},},}"
