ng the adventure:  ***\\n\\n\\nThere will be a few books you can find throughout this adventure.\\n\\nWatch for:\\n\\nOrange books under skulls: These are narrative information, that will guide you through the story\\'s progression. (7 in all)\\n\\n*Also, seek out the journal on a desk across the hall. It will prove very useful in the story. (1 only)\\n\\n(There will be a few books on shelves or displays, that are simply Easter eggs )\\n\\nI hope you enjoy!\\n\\n(Don\\'t forget to read the first story book before going though the portal!)\\n\\n\\n** *IF you are ported back here, you died!',},['SizeY']=47,['Y']=10633,['Color']=33591,['SizeZ']=47,},[224]={['Contrast']=1.500000,['Groups']=0,['Id']=3606,['EffectType']=8502,['Pitch']=4.712564,['Z']=41493,['SizeX']=21.456456,['Alpha']=1,['Yaw']=3.471460,['X']=15240,['Roll']=0,['MetaData']={['title']='Jarlaxle\\'s journal',['message']='House Nilvala has requested my aid to connect them with a wizard from the surface. They have even gone so far as to embrace the surface\\'s dark holiday, to welcome this wizard. \\n\\n\\nI have chosen to send Mortali, an insufferable, pompous fool I have had the displeasure of working with before. He is quite skilled, just as requested, but I\\'m hoping his mouth might get house Nilvala to rid me of him permanently. We shall see.\\n\\n\\nMortali arrived today. I quickly sent Beilon to guide him out before I killed him myself. I had them go through the breakroom and out the back into the Underdark. \\n\\n\\nThey\\'ll have to keep to the upper pathway to the left, since poisonous gasses have built back up blocking the lower path. There are many dangers between here and the secret tunnel that leads into the library of house Nilvala. Perhaps he\\'ll never even make it to the house ... such a pity.\\n\\n\\nWe have sensed multiple scrying attempts from the surface, allies of Mortali I would bet. Let them come and seek him out... We will allow them to pass for now. .... after all, they could prove quite amusing.\\n\\n\\nAn ally of Mortali came today. From above, we watched him bumble around my office, then out into the Underdark .... He did not make it very far.\\n\\n\\nToday they sent two allies of Mortali. For such an irritating human, they are persistent in finding him. They almost found the secret door, but got sidetracked by the emeralds to the North. ... Basilisks do not like to be disturbed. \\n\\n\\nAnother comes now...  \\n                                   ....We will be watching.',},['SizeY']=30,['Y']=10583,['Color']=194574,['SizeZ']=30,},[225]={['Pitch']=4.712564,['Id']=3607,['EffectType']=4,['Z']=39658,['Groups']=0,['SizeX']=1080,['Alpha']=1,['Contrast']=1,['Yaw']=4.028220,['X']=13573,['Roll']=0,['SizeY']=280,['Y']=10999,['Color']=999999,['SizeZ']=280,},[226]={['Pitch']=0,['Id']=3608,['EffectType']=12,['Z']=29673,['Groups']=0,['SizeX']=500,['Alpha']=1,['Contrast']=1,['Yaw']=4.747296,['X']=30726,['Roll']=0,['SizeY']=1,['Y']=10241,['Color']=0,['SizeZ']=500,},[227]={['Pitch']=1.570971,['Id']=3611,['EffectType']=829,['Z']=32760,['Groups']=0,['SizeX']=1320,['Alpha']=1,['Contrast']=1,['Yaw']=0.015708,['X']=29225,['Roll']=0,['SizeY']=2720,['Y']=10624,['Color']=241900,['SizeZ']=2720,},[228]={['Contrast']=1,['Groups']=0,['Id']=3613,['EffectType']=847,['Pitch']=3.141767,['Z']=30295,['SizeX']=470,['Alpha']=0.040000,['Yaw']=0.261799,['X']=29356,['Roll']=0,['MetaData']={['pattern scale % (y)']=100,['pattern scale % (x)']=100,},['SizeY']=192.982456,['Y']=10105,['Color']=530100,['SizeZ']=192.982456,},[229]={['Pitch']=4.712564,['Id']=3619,['EffectType']=5053,['Z']=29729,['Groups']=0,['SizeX']=94.669405,['Alpha']=1,['Contrast']=1.320000,['Yaw']=0.048869,['X']=29330,['Roll']=0,['SizeY']=540,['Y']=10028,['Color']=0,['SizeZ']=540,},[230]={['Pitch']=4.708898,['Id']=3620,['EffectType']=832,['Z']=30264,['Groups']=0,['SizeX']=242,['Alpha']=1,['Contrast']=0.620000,['Yaw']=4.680973,['X']=29543,['Roll']=0,['SizeY']=580,['Y']=9936,['Color']=19,['SizeZ']=580,},[231]={['Pitch